function EducationSchool({department, endYear, faculty, grade, major, name, startYear, type}) {
    return (
        <div>
            <h1>{startYear} - {endYear}</h1>
            <h2>{type}</h2>
            { department &&
                <h3>{department}</h3>
            }
            { faculty && 
                <h3>{faculty}</h3>
            }
            <h3>{major}</h3>
            { grade &&
                <h4>{grade}</h4>
            }
            <h1>{name}</h1>
        </div>
    )
}

export default EducationSchool
